import React from "react";
import Modal from "./Modal";
import "./leaderBoard.css";
import axios from "../utils/axios";

export default ({ players, score, onClickRestart }) => {
  let listPlayer;
  console.log(players);
  if (Array.isArray(players) && players.length >= 0) {
    listPlayer = players.map((player) => (
      <li key={player.username}>
        <p className="player-name">{player.username}</p>
        <p className="player-score">{player.score}</p>
      </li>
    ));
  }

  return (
    <Modal id="leader-board">
      <div className="wrapper-leader-board">
        {/* <div className="logo">
            
        </div> */}
        <img
          className="logo-2"
          src={require("../assets/logo-2.png")}
          alt="logo"
        />
        <img
          className="tray"
          src={require("../assets/food-tray.png")}
          alt="tray"
        />
        <div className="title-board">
          <h1>LẨU PHAN</h1>
          <p>Bảng xếp hạng</p>
          <div className="solid"></div>
        </div>
        <div className="scores-wrapper">
          <ul>
            {listPlayer && listPlayer}

            <div className="solid"></div>
          </ul>
          <div className="your-score">
            <p>Điểm số của bạn:</p>
            <h1 className="player-score" id="my-score">
              {score}
            </h1>
          </div>
          <button
            className="btn-retry"
            onClick={() => {
              onClickRestart();
            }}
          >
            Thử lại!
          </button>
        </div>
      </div>
    </Modal>
  );
};
